import axios from 'axios';
import React from 'react';

class CollectClinicals extends React.Component{
    state={}

    componentDidMount(){
        axios.get("http://localhost:8080/clinicalservices/api/patients/"+this.props.match.params.patientId).then(res=>{

            this.setState(res.data)
        })
    }
    render(){
        return (<div>
            <h2>Patient Details:</h2>
            First Name: {this.state.firstName}
            Last Name: {this.state.lastName}
            Age: {this.state.age}
            <h2>Clinical Data:</h2>
            <form>
                Clinical Entry Type <select>
                    <option value="bp">Blood Pressure(Sys/Dys)</option>
                    <option value="hw">Height/Weight</option>
                    <option value="bp">Heart Rate</option>
                </select>
                Value:<input type="text" name="componentValue"></input>
                <button onClick={this.handleSubmit.bind(this)}></button>
            </form>
        </div>)
    }
}

export default CollectClinicals;
